import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <ul className="footer__social">
        <li>
          <a href="https://github.com/NickButnar">
            <img></img>
          </a>
        </li>
      </ul>

    </div>
  )
}

export default Footer;
